  [],\n\t\"num_tags\": 0,\n\t\"name\": \"ocean-surface-topography-mission-ostm-jason-3-auxiliary-files-2015-nodc-accession-0122597\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Jason-3 is the fourth mission in U.S.-European
  series of satellite missions that measure the height of the ocean surface. Scheduled
  to launch in 2015, the mission will extend the time series of ocean surface topography
  measurements begun by the TOPEX/Poseidon satellite mission in 1992 and continuing
  through the currently operating Jason-1 (launched in 2001) and OSTM/Jason-2 (launched
  in 2008) missions. These measurements provide scientists with critical information
  about circulation patterns in the ocean and about both global and regional changes
  in sea level and the climate implications of a warming world.nnTOPEX/Poseidon and
  Jason-1 were cooperative missions between NASA and the French space agency, CNES.
  Additional partners in the Jason-2 mission included NOAA and Eumetsat. Jason-3 continues
  the international cooperation, with NOAA and Eumetsat leading the efforts, along
  with partners NASA and CNES.nnThe primary instrument on Jason-3 is a radar altimeter.
  The altimeter measures sea-level variations over the global ocean with very high
  accuracy (as 1.3 inches or 3.3 centimeters, with a goal of achieving 1 inch or 2.5
  centimeters).nnThese auxiliary data files are used to generate Level-2 products.
  They include both static tabular data files and dynamic files which change/grow
  over time. Auxiliary files are produced outside of OSTM, but are used in product
  development. Filetypes in the Auxiliary data family (J3-AUX) which are produced
  by the European Center for Medium range Weather Forecasting (ECMWF) are restricted
  by ECMWF to the Jason-3 project team.nnAdditional documentation for Jason-3 data
  is archived at the NODC at:nhttps://archive.nodc.noaa.gov/cgi-bin/AMS/prod/accession/details/118276.
  The documentation includes metadata in International Standards Organization (ISO)
  format.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
